import React from "react";
import "./itemList.css";

const ItemList = props => {
  let today = new Date();
  console.log(today);
  let date =
    today.getFullYear() + "-" + today.getMonth() + "-" + today.getDate();

  this.state = {
    user: {
      firstName: "",
      lastName: "",
      email: "",
      avatar: src(
        "https://images.emojiterra.com/google/android-pie/512px/1f937-2640.png"
      )
    }
  };
  return (
    <div>
      <ul className="item-list">
        {props.items.map(item => {
          return (
            <figure>
              <img></img>
              <figcaption>
                <div>{date}</div>
                <div key={item.id}></div>
                <div>{item.text}</div>
                <div>{item.spend}</div>
              </figcaption>
            </figure>
          );
        })}
      </ul>
    </div>
  );
};

export default ItemList;
